  \"2016-11-18T16:40:08.961867\",\n\t\"name\": \"boise-parks-and-reserves-open-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This is a polygon data set representing
  Boise Parks and Recreation data, based on the National Parks and Recreation Association
  (NRPA) GIS Data Model. A park is generally an area of land in a largely natural
  state, sometimes with grass, trees, paths, sports fields, playgrounds, picnic areas
  and other facilities, that is set aside and managed specifically for recreation
  use and enjoyment by the public. The features included in this polygon feature class
  are; parks, reserves, city maintained cemeteries, city maintained road rights-of-ways
  and greenbelt areas. This data set was created from a combination of Boise Parks
  and Recreation park and facility files and the Ada County Parcel records. This dataset
  was created by POWER Engineer's, Inc. and will be maintained by the City of Boise.
  This data set is updated at the request of Boise Parks and Recreation staff, as
  changes to the park data occur. It is current to the date it was published.\",\n\t\"license_title\":
